ontology_addendum.graph:
@prefix co: <https://example.com/ont_cpf#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

co:CoolingTechnique a rdfs:Class ;
    rdfs:label "Cooling Technique" ;
    rdfs:comment "Methods used to achieve low temperatures, such as liquid helium cooling." .

co:ExperimentalInvestigation a rdfs:Class ;
    rdfs:label "Experimental Investigation" ;
    rdfs:comment "A systematic study conducted to explore the properties of materials at cryogenic temperatures." .

co:Material a rdfs:Class ;
    rdfs:label "Material" ;
    rdfs:comment "A substance or mixture of substances that has specific physical properties." .

co:QuantumFluid a rdfs:Class ;
    rdfs:label "Quantum Fluid" ;
    rdfs:comment "A state of matter that exhibits quantum mechanical effects on a macroscopic scale, typically at low temperatures." .

co:Superconductivity a rdfs:Class ;
    rdfs:label "Superconductivity" ;
    rdfs:comment "A phenomenon where a material exhibits zero electrical resistance and expulsion of magnetic fields at low temperatures." .

co:CryogenicPhysicsOntology a owl:Ontology ;
    rdfs:label "Cryogenic Physics Ontology" ;
    rdfs:comment "Ontology for representing concepts in low-temperature physics, focusing on superconductivity and quantum fluids." .

co:hasCoolingTechnique a rdf:Property ;
    rdfs:label "has Cooling Technique" ;
    rdfs:comment "Links an experimental investigation to the cooling technique used." ;
    rdfs:domain co:ExperimentalInvestigation ;
    rdfs:range co:CoolingTechnique .

co:hasMaterial a rdf:Property ;
    rdfs:label "has Material" ;
    rdfs:comment "Links an experimental investigation to the material being studied." ;
    rdfs:domain co:ExperimentalInvestigation ;
    rdfs:range co:Material .

co:hasQuantumFluid a rdf:Property ;
    rdfs:label "has Quantum Fluid" ;
    rdfs:comment "Indicates if a material behaves as a quantum fluid." ;
    rdfs:domain co:Material ;
    rdfs:range co:QuantumFluid .

co:hasSuperconductivity a rdf:Property ;
    rdfs:label "has Superconductivity" ;
    rdfs:comment "Indicates if a material exhibits superconductivity." ;
    rdfs:domain co:Material ;
    rdfs:range co:Superconductivity .
